import CreateOrder from './models/orders';
import {Createlient} from './models/client';

function App() {



  return (
    <div class="container">
      <div className="App">

        <div>
          <br/>
          <div>
            <CreateOrder/>
          </div>
          <br/>
          <Createlient/>
        </div>
      </div>
    </div>
  );
}

export default App;
